import * as api from "../api";
import { FETCH_ALL } from "../constants/actionTypes";

// Action Creators 
export const getAllUsers = () => async (dispatch) => {
    try {
        const { data } = await api.fetchUsers();
        console.log("actions");
        console.log(data);
        dispatch({ type: FETCH_ALL, payload: data });
    } catch (error) {
        console.log(error.message)
    }
}
